import React, {Component} from 'react';
import {Row} from "react-bootstrap";

class Contacts extends Component {
    render() {
        return (
            <div className={'Contacts container-fluid'}>
                <Row>
                    <h1>It's a Contacts Page</h1>
                </Row>
            </div>
        );
    }
}

export default Contacts;
